import React from 'react'
import web from '../src/Images/img1.webp';
import { NavLink } from 'react-router-dom';

const Card = () => {
    return (
        <>

            <div className="col-md-4 col-10 mx-auto">
                <div N="card" >
                    <img src={web} N="card-img-top" alt="..." />
                    <div N="card-body">
                        <h5 N="card-title">Card title</h5>
                        <p N="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                        <NavLink to="" N="btn btn-primary">Go somewhere</NavLink>
                    </div>
                </div>
            </div>


        </>
    );
};
export default Card;
